import { useState } from "react";
//import { useNavigate } from "react-router-dom";
import * as Realm from "realm-web";

function APP() {
  const APPID = "scanup-bnmev";
  const APP = new Realm.App({ id: APPID });

  const updateUser = async () => {
    const user = await APP.logIn(
      Realm.Credentials.emailPassword(
        "public@scanup.vicat.fr",
        "LeAheBaWtTRbM3KP"
      )
    );
    this.props.setUser(user);
    const client = APP.currentUser.mongoClient("mongodb-atlas");
    const db = client.db("scanup-db");
    const collection = db.collection("ScanDivision");
  };
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [certificat, setCertificat] = useState("");
  const [role, setRole] = useState("");
  const [division, setDivision] = useState("");

  // db.collection.insert({ certificat: {certificat}, division : {division},
  //   password: {password}, role:{role},user:{email}, partition : {partition});

  return (
    <div>
      <h1> Add user</h1>
      <form>
        <br />
        <input
          value={email}
          type="email"
          placeholder="Email"
          onChange={(e) => setEmail(e.target.value)}
        />
        <br />
        <input
          type="text"
          value={password}
          placeholder="Password"
          onChange={(e) => setPassword(e.target.value)}
        />
        <br />
        <input
          type="text"
          value={certificat}
          placeholder="Certificat"
          onChange={(e) => setCertificat(e.target.value)}
        />
        <br />
        <input
          type="text"
          value={role}
          placeholder="Role"
          onChange={(e) => setRole(e.target.value)}
        />
        <br />
        <input
          type="text"
          value={division}
          placeholder="Division"
          onChange={(e) => setDivision(e.target.value)}
        />
        <br />
        <input type="submit" value="Add " onClick="insertUser()" />
      </form>
    </div>
  );
}

export default APP;

